/**
 * @param type
 * @return
 */
public static GOMAttribute getAttributeByContentTypeDefaultNs(
		ContentType type) {
	if (type == null)
		return TEXT_TYPE_DEFAULT_NS;
	switch (type) {
	case HTML:
		return HTML_TYPE_DEFAULT_NS;
	case XHTML:
		return XHTML_TYPE_DEFAULT_NS;

	default:
		return TEXT_TYPE_DEFAULT_NS;
	}

}

